import React from 'react'
import { useSelector} from "react-redux"

function Favorite() {

    const selector = useSelector(state => state.allMovieReducer)

  return (
    <div>
        {
            selector.map((a,b)=>(
                <div key={b}>

                    <p>{a.Year}</p>


                </div>
            ))
        }
    </div>
  )
}

export default Favorite
